import React from 'react';
import YouTube from 'react-youtube';

const MusicPlayer = ({ videoId }) => {
    return (
        <div style={{ marginTop: '20px' }}>
            {videoId ? <YouTube videoId={videoId} /> : <p>Select a track to play</p>}
        </div>
    );
};

export default MusicPlayer;
